import axios from 'axios';

function sendScore(username, score) {
    axios.post('http://localhost:8080/scores', {
        username: username,
        score: score
    })
        .then(response => {
            console.log(response.data);
        })
        .catch(error => {
            console.error("Błąd przy wysyłaniu wyniku:", error);
        });
}
